dci.transformation:
switch ($1) {
	case "1": return "OK";
	case "2": return "Replace Battery";
	default: return "INVALID DATA (".$1.")";
}

switch ($1) {
	case "1": return "Calibrated";
	case "2": return "Not Calibrated / Unsupported";
	case "3": return "In Progress";
	default: return "INVALID DATA (".$1.")";
}

switch ($1) {
	case "1": return "OK";
	case "2": return "FAILED";
	case "3": return "Invalid Test / Unsupported";
	case "4": return "In Progress";
	default: return "INVALID DATA (".$1.")";
}

