switch ($1) {
	case "1": return "Unknown";
	case "2": return "OK";
	case "3": return "Low Battery";
	default: "INVALID DATA (".$1.")";
}

template.filter:
if (classof($object) != "Node")
	return false;
if (!$node->isSNMP)
	return false;
if (
	( $node->snmpOID == ".1.3.6.1.4.1.318.1.3.27" )
	|| ( $node->snmpOID == ".1.3.6.1.4.1.318.1.3.2.7" )
) { return true; }
if ( $node->isAgent )
{	
	if ( $node->platformName ~= "windows")
	{
		table = AgentReadTable($node, "System.InstalledProducts");
		if ( table == null ) return NULL;
		colName = table->getColumnIndex("NAME");
		colVersion = table->getColumnIndex("VERSION");
		for (currentRow = 0; currentRow < table->rowCount; currentRow++)
		{
			if (
				( table->get(currentRow, colName) == "PowerChute Business Edition Agent" )
				&& (
					( ! ( table->get(currentRow, colVersion) ~= "^9.5." ) )
					&& ( ! ( table->get(currentRow, colVersion) ~= "^10." ) )
				)
			) { return true; }
		}
	}
	return false;
}
